func printNumerologie(numerologie: NumerologieCore, sL: L, dBornDate: Date) -> String {
    var html = html_print_numerologie
    var temp: String = load(dBornDate: dBornDate)
    html = html.replacingOccurrences(of: "@Naissance@", with: temp)
    temp = String(age(dBornDate: dBornDate))
    html = html.replacingOccurrences(of: "@Age@", with: temp)
    temp = cheminDeVie(dBornDate: dBornDate)
    html = html.replacingOccurrences(of: "@CDV@", with: temp)
    temp = cycleAdjacents(dBornDate: dBornDate, eCycle: .Formatif)
    html = html.replacingOccurrences(of: "@Formatif@", with: temp)
    temp = cycleAdjacents(dBornDate: dBornDate, eCycle: .Productif)
    html = html.replacingOccurrences(of: "@Productif@", with: temp)
    temp = cycleAdjacents(dBornDate: dBornDate, eCycle: .Moisson)
    html = html.replacingOccurrences(of: "@Moisson@", with: temp)

    temp = numerologie.cycleRealisation(iLivePath: cheminDeVieInt(dBornDate: dBornDate), eCycle: .JplusM)
    html = html.replacingOccurrences(of: "@AgeRealisationJM@", with: temp)
    temp = jPlusMInt(dBornDate: dBornDate)
    html = html.replacingOccurrences(of: "@NombreRealisationJM@", with: temp)

    temp = numerologie.cycleRealisation(iLivePath: cheminDeVieInt(dBornDate: dBornDate), eCycle: .JplusA)
    html = html.replacingOccurrences(of: "@AgeRealisationJA@", with: temp)
    temp = jPlusAInt(dBornDate: dBornDate)
    html = html.replacingOccurrences(of: "@NombreRealisationJA@", with: temp)

    temp = numerologie.cycleRealisation(iLivePath: cheminDeVieInt(dBornDate: dBornDate), eCycle: .UnplusDeux)
    html = html.replacingOccurrences(of: "@AgeRealisation12@", with: temp)
    temp = unPlusDeuxInt(dBornDate: dBornDate)
    html = html.replacingOccurrences(of: "@NombreRealisation12@", with: temp)

    temp = numerologie.cycleRealisation(iLivePath: cheminDeVieInt(dBornDate: dBornDate), eCycle: .MplusA)
    html = html.replacingOccurrences(of: "@AgeRealisationMA@", with: temp)
    temp = mPlusAInt(dBornDate: dBornDate)
    html = html.replacingOccurrences(of: "@NombreRealisationMA@", with: temp)

    return html
}
